import React, { Component} from 'react';


export class Login extends Component {

    constructor(props){
        super(props);
    }
    
    
    render(){
        return (
            <div>
                <h1>Login User</h1>    

                <label>
                    Username:
                    <input type="text" name="username"/>   
                </label>  
                <label>
                    Password:
                    <input type="password" name="pa"/>   
                </label>        
            </div>
            )
    }
}
